$(document).ready(function(){
   

    $("#school-name-search").keyup(function(){
        returned_list = ""
        let entered_letters = $(this).val()
        // obj.name.includes(entered) || obj.category.includes(entered
        filtered_list = schools.filter(obj => (obj.School_name.includes(entered_letters)))
        for (single_item of filtered_list){
            returned_list += '<li class="selection" state="'+ single_item.State +'"  line1="'+ single_item.Address_line_1 +
            '" line2="'+ single_item.Address_line_2 +'" line3="'+ single_item.Address_line_3 +'" City ="'+ single_item.City +
            '" Area="'+ single_item.Area +'" phone="'+ single_item.Telephone +'">' + single_item.School_name + '</li>'
        }
        
        $("#found_items").html(returned_list)
        $("#found_items").show()
        $(".business-search-result").text("")
        $("#correct-details").hide()


        checker = $("#found_items").text()
        if(checker == ""){
        $(".all-search-group").hide()
        $(".add-school").show()
        // alert("blank")
    }
    
})

$(".new-search").click(function(){
    $(".all-search-group").show()
    $(".add-school").hide()
    $("#school-name-search").val("")

       
      })
      
    
       $(document).on("click", ".selection", function(){
        business_name =  $(this).text()
        address1 =  $(this).attr("line1")
        address2 =  $(this).attr("line2")
        address3 =  $(this).attr("line3")
        phone =   $(this).attr("phone")
        Area =   $(this).attr("Area")
        State =   $(this).attr("State")
        City =   $(this).attr("City")
    
        
        
        
        
        $("#School_name").text(business_name)
        $("#ownership").text()
        $("#Nursery").text()
        $("#Primary").text()
        $("#Junior_Secondary").text()
        $("#Senior_Secondary").text()
        $("#Address_line_1").text(address1)
        $("#Address_line_2").text(address2)
        $("#Address_line_3").text(address3)
        $("#Area").text(Area)
        $("#City").text(City)
        
        $("#nature_of_business").text("School Location: " + State)


        $("#found_items").hide()
        $("#school-name-search").val("")
        $("#business-search-result").show()
        // $(".correction-btn").show()
        $("#correct-details").show()


       })
       
       $(".corrector").click(function(){
        namer = $("#School_name").text()
        $("#detail-1").val(namer)
        $("#detail-1").prop("disabled", true)
        $(this).prop("disabled", true)    



       })

       $(".update-edit").click(function(){
        // namer = $("#School_name").hide()
        // $("#detail-1").hide()
        $("#detail-1").prop("disabled", false)
        $(".save-edit").show()
        // $(".editor-content").show()
        $(".editor-input").show()
        $(this).hide()
       })
  
       $(".undo-edit").click(function(){
        $("#detail-1").show()
        $(".editor-input").hide()
        $(".save-edit").show()
        $(this).hide()
       })
       $(".save-edit").click(function(){
        $(".update-edit").show()
        $("#detail-1").prop("disabled", true)

        $(this).hide()
       })



  
});